import React from 'react';

const SpacecraftList = (spacecraft) => {
    return (
        <div className="container">
                        <div>
                          <img src={`${spacecraft.pictureUrl}`}/>
                        </div>
                        <p>Name: {`${spacecraft.name}`}</p>
                        <p>Capacity: {`${spacecraft.capacity}`}</p>
                    </div>
    )
}

export default SpacecraftList;
